import styled from "styled-components";

export const DivInputUpload = styled.div`
  width: 50%;
  margin: 0 auto;
  margin-top: 50px;
  background: #ffffff;
  border: 1px solid #e5e5e5;
  box-sizing: border-box;
  border-radius: 6px;
  padding: 20px;

  .title {
    color: #002240;
  }

  .text-help {
    margin-top: -15px;
    color: #0089ff;
  }
`;

export const DivInputUploadDetail = styled.div`
  padding-bottom: 100px;
  border-bottom: 1px solid #e5e5e5;
`;
